const bloxy = require("../");
/**
 * @type {Client}
 */
const client = new bloxy.Client({
	setup: {
		debugging: false
	},
	credentials: {
		cookie: "_|WARNING:-DO-NOT-SHARE-THIS.--Sharing-this-will-allow-someone-to-log-in-as-you-and-to-steal-your-ROBUX-and-items.|_"
	}
});

client.login().then(user => {
	console.log(user);
});

client.on("loggedIn", () => {
	console.log("User logged in");
});
